description:
Little Panda's Game: My World is a fun children's game! You can explore, design, and role-play to build family life, school life, and more to create any story you like! Start exploring this real and fairy-tale-like mini world now!

EXPLORE EVERY LOCATION
You can go anywhere freely in the game world for fun explorations. Design rooms, cook food, create art, go mall shopping, try role-play, relive fairy tales, and more! You will also discover all the hidden games at school, on the farm, in the club room, police station, magic train, mushroom house, animal shelter, and vacation hotel, magic academy, and many other places!

MAKE FRIENDS AND CREATE CHARACTERS
An increasing number of characters from real life and fairy tales will come to the town. The doctor, house designer, policeman, supermarket staff, princess, mage, and other characters are looking forward to becoming your friends. You can also create your own characters by customizing their skin color, hairstyle, expression, and more, and dress them up with different clothes and accessories! Play dress-up games in your own way!

EXPRESS YOURSELF FREELY AND TELL STORIES
In this mini-world, there are no rules or goals. You can create endless stories and discover lots of surprises. Are you ready to tell your own story in the game world? Dress up with your new friends, play party games, experience school life, hold Halloween events, get gifts, decorate your dream house, and celebrate every holiday! This is where your fairy-tale dreams come true!

Can't wait to explore this world? Then download Little Panda's Game: My World now and create happy memories of world life with your new friends through exploration, creation, decoration, imagination, and more!

FEATURES:
- Explore a mini-world with both realistic and fairy-tale scenes;
- Create your own stories without any game goals or rules;
- Customize your own characters: skin color, hairstyle, clothes, expression, etc.
- Decorate your house with hundreds of items like furniture, wallpaper, and more;
- 50+ buildings and 60+ themed scenes to discover;
- 10+ different costume packs for you to use;
- Countless characters to befriend;
- 6,000+ interactive items to use;
- All characters and items can be used freely across scenes;
- Supports offline play;
- Special festival items are added accordingly.

About BabyBus
—————
At BabyBus, we dedicate ourselves to sparking kids' creativity, imagination and curiosity,and designing our products through the kids' perspective to help them explore the world on their own.

Now BabyBus offers a wide variety of products, videos and other educational content for over 600 million fans from ages 0-8 around the world! We have released over 200 children's apps, over 2500 episodes of nursery rhymes and animations, over 9000 stories  of various themes spanning the Health, Language, Society, Science, Art and other fields.

